import React, { Component } from 'react';
import { Nav, Button,Form,Navbar } from 'react-bootstrap'
import fire from '../../cofigFile/firebase';


export default class cnavbar extends Component {


    logout(){
        fire.auth().signOut();
    }

    render() {
        return (

            <div class="navbar navbar-default navbar-fixed-top">
            <div class="navbar-header"><a class="navbar-brand" href="#"><img src="images/logo.png" alt="Your Logo"/></a>
                 <a class="navbar-toggle" data-toggle="collapse" data-target=".navbar-collapse">
                   <span class="icon-bar"></span>
                   <span class="icon-bar"></span>
                   <span class="icon-bar"></span>
                 </a>
               </div>
               <div class="navbar-collapse collapse">
                 <ul class="nav navbar-nav">
                   <li class="active"><a href="#">Home</a></li>
                   <li><a href="#">Services</a></li>
                 </ul>
          
               </div>
           </div>
        )
    }
}
